import { createSlice } from "@reduxjs/toolkit";

const initialPostState = JSON.parse(localStorage.getItem("UserPost")) || {
  posts: [
    {
      userId: 6,
      caption:
        "The sun peeked through the clouds, painting the sky with hues of orange and pink as the birds sang their morning melodies.",
      imgUrl:
        "data:image/jpeg;base64,",
      id: 1700135329217,
    },
    {
      userId: 6,
      caption:
        "The sun peeked through the clouds, painting the sky with hues of orange and pink as the birds sang their morning melodies.",
      imgUrl:
        "data:image/jpeg;base64,",
      id: 1700135358566,
    },
    {
      userId: 6,
      caption:
        'font-[600] text-[15px]"The sun peeked through the clouds, painting the sky with hues of orange and pink as the birds sang their morning melodies."',
      imgUrl:
        "data:image/jpeg;base64,",
      id: 1700138284938,
    },
    {
      userId: 6,
      caption:
        'th"The sun peeked through the clouds, painting the sky with hues of orange and pink as the birds sang their morning melodies."',
      imgUrl:
        "data:image/jpeg;base64,",
      id: 1700138319583,
    },
  ],
};

const postSlice = createSlice({
  name: "posts",
  initialState: initialPostState,
  reducers: {
    addPost(state, action) {
      const { userId, caption, imgUrl, id } = action.payload;
      state.posts.push({ userId, caption, imgUrl, id });
    },
    removePost(state, action) {
      const postId = action.payload;
      state.posts = state.posts.filter((post) => post.id !== postId);
    },
    // Other reducers can be added as needed
  },
});

export const { addPost, removePost } = postSlice.actions;
export default postSlice.reducer;
